Meteor.startup(function () {
  UploadServer.init({
    tmpDir: process.env.PWD + '/public/images/upload/tmp',
    uploadDir: process.env.PWD + '/public/images/upload',
    checkCreateDirectories: true //create the directories for you
  });
});
